import styled from 'styled-components'

const ExpandChatTabBarButton = styled.button`
    width: 24px; 
    height: 24px; 
    cursor: pointer; 
    outline: 0; 
    border: 0; 
    background-color: transparent; 
`

export default ExpandChatTabBarButton
